Distribution and habitat:
This species has been collected from a number of sites beneath granite rocks, in marri (

Corymbia calophylla

) leaf litter, and amongst sedges in Waychinicup Nature Reserve and Two Peoples Bay Nature Reserve, east of Albany (
Fig. 5
).
